import React from 'react';
import { Component } from 'react';
import { connect } from 'react-redux';
import { withRouter } from 'react-router-dom';
import Occupational from './list/occupational.js';
import { ToastContainer } from 'react-toastify';

class ItemList extends Component {

    componentWillMount() {
    }

    componentDidUpdate() {
    }

    render() {
        return (
            <div className="container" style={{ width: "90%" }}>
                <ToastContainer />
                <div className="text-left titulo">
                    <h4>Lista de configuraciones</h4>
                </div>
                <br />
                <div className="shadow" style={{ background: "#FFFFFF", padding: "30px" }}>
                    <nav>
                        <div class="nav nav-tabs" id="nav-tab" role="tablist">
                            <a class="nav-item nav-link active" id="nav-area-tab" data-toggle="tab" href="#nav-area" role="tab" aria-controls="nav-area" aria-selected="true">Área </a>
                            <a class="nav-item nav-link" id="nav-core-tab" data-toggle="tab" href="#nav-core" role="tab" aria-controls="nav-core" aria-selected="false">Núcleo </a>
                            <a class="nav-item nav-link" id="nav-thematic-tab" data-toggle="tab" href="#nav-thematic" role="tab" aria-controls="nav-thematic" aria-selected="false">Temática</a>
                            <a class="nav-item nav-link" id="nav-occupational-tab" data-toggle="tab" href="#nav-occupational" role="tab" aria-controls="nav-occupational" aria-selected="false">ocupacional</a>
                            <a class="nav-item nav-link" id="nav-professional-tab" data-toggle="tab" href="#nav-professional" role="tab" aria-controls="nav-professional" aria-selected="false">profesional</a>
                            <a class="nav-item nav-link" id="nav-competition-tab" data-toggle="tab" href="#nav-competition" role="tab" aria-controls="nav-competition" aria-selected="false">Competencia</a>
                            <a class="nav-item nav-link" id="nav-competitionG-tab" data-toggle="tab" href="#nav-competitionG" role="tab" aria-controls="nav-competitionG" aria-selected="false">Competencia genérica</a>
                            <a class="nav-item nav-link" id="nav-distinctive-tab" data-toggle="tab" href="#nav-distinctive" role="tab" aria-controls="nav-distinctive" aria-selected="false">Distintivo</a>
                        </div>
                    </nav>
                    <div class="tab-content" id="nav-tabContent">
                        <div class="tab-pane fade show active" id="nav-area" role="tabpanel" aria-labelledby="nav-area-tab">...</div>
                        <div class="tab-pane fade" id="nav-core" role="tabpanel" aria-labelledby="nav-core-tab">...</div>
                        <div class="tab-pane fade" id="nav-thematic" role="tabpanel" aria-labelledby="nav-thematic-tab">...</div>
                        <div class="tab-pane fade" id="nav-occupational" role="tabpanel" aria-labelledby="nav-occupational-tab"><Occupational /></div>
                        <div class="tab-pane fade" id="nav-professional" role="tabpanel" aria-labelledby="nav-professional-tab">...</div>
                        <div class="tab-pane fade" id="nav-competition" role="tabpanel" aria-labelledby="nav-competition-tab">...</div>
                        <div class="tab-pane fade" id="nav-competitionG" role="tabpanel" aria-labelledby="nav-profile-tab">...</div>
                        <div class="tab-pane fade" id="nav-distinctive" role="tabpanel" aria-labelledby="nav-distinctive-tab">...</div>
                    </div>
                </div>
                <br />
            </div>
        );
    }

}

function mapStateToProps(state) {
    return {

    }
}

export default withRouter(connect(mapStateToProps, {})(ItemList));
